INSERT INTO `answers` VALUES (1,1,'Các phần tử bán dẫn công suất được sử dụng trong sơ đồ các bộ biến đổi như khóa điện tử, gọi là vác van bán dẫn; khi mở dẫn dòng thì nối tải vào nguồn, khi khóa thì ngắt tải ra khỏi nguồn, không làm cho dòng điện chạy qua.',1,'2021-02-04 20:36:13','2021-02-25 20:09:20'),(2,1,'Quy luật nối tải vào nguồn không phụ thuộc vào sơ đồ bộ biến đổi và phụ thuộc cách thức điều khiển các van trong bộ biến đổi.',0,'2021-02-04 20:36:13','2021-02-25 20:09:20'),(3,1,'Công nghệ chế tạo các phần tử bán dẫn ngày nay đã đạt được những bước tiến bộ vượt bậc, với việc cho ra đời những phần tử kích thước ngày càng nhỏ gọn, khả năng đóng cắt dòng điện và chịu điện áp cao ngày càng lớn với tổn hao công suất giảm đáng kể, ngày càng đáp ứng những yêu cầu phức tạp của các quy luật biến đổi năng lượng trong các bộ biến đổi.',1,'2021-02-04 20:36:13','2021-02-25 20:09:20'),(4,1,'Tính năng kỹ thuật phụ của các phần tử bán dẫn công suất thể hiện qua khả năng đóng cắt dòng điện, khả năng chịu điện áp và các đặc tính liên quan đến quá trình đóng cắt cũng như vấn đề điều khiển chúng.',0,'2021-02-04 20:36:13','2021-02-25 20:09:20'),(5,2,'Đi ốt chỉnh lưu thường, Đi ốt quang, LED, Đi ốt Laser, ...',1,'2021-02-04 20:36:13','2021-02-25 22:29:43'),(6,2,'Đi ốt chỉnh lưu thường, Đi ốt Schottky, LED, Đi ốt biến, ...',0,'2021-02-04 20:36:13','2021-02-25 22:29:43'),(7,2,'Đi ốt Zener, Đi ốt quang, LED, Đi ốt điện, ...',0,'2021-02-04 20:36:13','2021-02-25 22:29:43'),(8,2,'Đi ốt tín hiệu, Đi ốt quang, Đi ốt từ, Đi ốt Laser, ...',0,'2021-02-04 20:36:13','2021-02-25 22:29:43'),(9,3,'Là phần tử được cấu tạo bởi hai lớp tiếp giáp bán dẫn p-n',0,'2021-02-04 20:36:13','2021-02-25 22:28:27'),(10,3,'Có hai cực, anot A là cực nối với lớp bán dẫn kiểu p, catot K là cực nối với lớp bán dẫn kiểu n.',1,'2021-02-04 20:36:13','2021-02-25 22:28:27'),(11,3,'Dòng điện chỉ chạy qua diot theo chiều từ K đến A khi điện áp UAK dương.',0,'2021-02-04 20:36:13','2021-02-25 22:28:27'),(12,3,'Khi UAK âm, dòng qua diot gần như băng không.',0,'2021-02-04 20:36:13','2021-02-25 22:28:27'),(13,4,'Ở biên giới hai bên mặt tiếp giáp, một số điện tử bị lỗ trống thu hút và khi chúng tiến lại gần nhau, chúng có xu hướng phân ly tạo thành các nguyên tử trung hòa. Quá trình này có thể giải phóng năng lượng dưới dạng ánh sáng hình thành điện áp tiếp xúc.',0,'2021-02-04 20:36:13','2021-02-25 22:30:47'),(14,4,'Nếu đặt điện áp bên ngoài ngược với điện áp tiếp xúc, sự khuyếch tán của các điện tử và lỗ trống không bị ngăn trở bởi điện áp tiếp xúc nữa và vùng tiếp giáp dẫn điện tốt.',1,'2021-02-04 20:36:13','2021-02-25 22:30:47'),(15,4,'Do tính chất dẫn điện một chiều nên Diode thường được sử dụng trong các mạch chỉnh lưu nguồn xoay chiều thành một chiều, các mạch tách sóng, mạch ghim áp phân cực cho transistor hoạt động.',1,'2021-02-04 20:36:13','2021-02-25 22:30:47'),(16,4,'Nếu đặt điện áp bên ngoài cùng chiều với điện áp tiếp xúc, sự khuyếch tán của các điện tử và lỗ trống không bị ngăn trở bởi điện áp tiếp xúc nữa và vùng tiếp giáp dẫn điện tốt.',0,'2021-02-04 20:36:13','2021-02-25 22:30:47'),(17,5,'Đi ot',0,'2021-02-04 20:36:13','2021-02-25 22:32:46'),(18,5,'Triac',0,'2021-02-04 20:36:13','2021-02-25 22:32:46'),(19,5,'Tranzitor',0,'2021-02-04 20:36:13','2021-02-25 22:32:46'),(20,5,'Tiristor',1,'2021-02-04 20:36:13','2021-02-25 22:32:46'),(21,6,'Trường hợp  Cực G để hở hay VG = OV: Có nghĩa là transistor T1 không có phân cực ở cực B nên T1 duy trì dòng điện.',0,'2021-02-04 20:36:13','2021-02-25 22:35:48'),(22,6,'Trường hợp  Cực G để hở hay VG = OV: Khi điện áp nguồn VCC được tăng lên đủ mức lớn, sẽ kéo theo điện áp VAK tăng theo đến điện thế ngập VBO lúc đó điện áp VAK sẽ giảm xuống như diode và lúc này dòng điện IA tăng nhanh.',1,'2021-02-04 20:36:13','2021-02-25 22:35:48'),(23,6,'Trường hợp Trường hợp phân cực ngược Tiristor: Phân cực ngược Tiristor là nối A vào cực âm, K vào cực dương của nguồn VCC. Trường hợp này giống như diode bị phân cực ngược. Tiristor sẽ không dẫn điện mà chỉ có dòng rất nhỏ đi qua.',1,'2021-02-04 20:36:13','2021-02-25 22:35:48'),(24,6,'Trường hợp: Trường hợp phân cực ngược Tiristor:  Khi tăng điện áp ngược lên đủ lớn thì Tiristor sẽ bị đánh thủng và dòng điện qua theo chiều ngược lại. Điện áp ngược đủ để đánh thủng Tiristor là VBR, thông thường trị số VBR và VBO bằng nhau và cùng dấu.',0,'2021-02-04 20:36:13','2021-02-25 22:35:48'),(25,7,'Dòng điện thuận cực đại: Đây là trị số lớn nhất dòng điện qua mà Tiristor có thể chịu đựng liên tục, quá trị số này Tiristor vẫn có thể hoạt động được.',0,'2021-02-04 20:36:13','2021-02-25 22:37:36'),(26,7,'Điện áp ngược cực đại: Đây là điện áp ngược lớn nhất có thể đặt giữa A và K mà Tiristor chưa bị đánh thủng, nếu vượt qua trị số này Tiristor vẫn có thể hoạt động được.',0,'2021-02-04 20:36:13','2021-02-25 22:37:36'),(27,7,'Thời gian mở Tiristor: Là thời gian cần thiết hay độ rộng của xung kích để Tiristor có thể chuyển từ trạng thái ngưng sang trạng thái dẫn, thời gian mở khoảng vài micrô giây.',1,'2021-02-04 20:36:13','2021-02-25 22:37:36'),(28,7,'Dòng điện kích cực tiểu: IGmin : Để Tiristor có thể dẫn điện trong trường hợp điện áp VAK thấp thì phải có dòng điện kích cho cực G của Tiristor. Dòng IGmin là trị số dòng kích nhỏ nhất đủ để điều khiển Tiristor dẫn điện và dòng IGmin có trị số lớn hay nhỏ tùy thuộc công suất của Tiristor, nếu Tiristor có công suất càng lớn thì IGmin phải càng lớn.',1,'2021-02-04 20:36:13','2021-02-25 22:37:36'),(29,8,'Truyền tải điện thấp',0,'2021-02-04 20:36:13','2021-02-25 22:38:54'),(30,8,'Điều khiển động cơ DC và AC, bộ chỉnh lưu được điều khiển',1,'2021-02-04 20:36:13','2021-02-25 22:38:54'),(31,8,'Công tắc AC DC, chỉnh lưu không điều khiển',0,'2021-02-04 20:36:13','2021-02-25 22:38:54'),(32,8,'Hoạt động và phản ứng ngược',1,'2021-02-04 20:36:13','2021-02-25 22:38:54'),(33,9,'Đi ot',0,'2021-02-04 20:36:13','2021-02-25 22:42:43'),(34,9,'Triac',1,'2021-02-04 20:36:13','2021-02-25 22:42:43'),(35,9,'Tiristor',0,'2021-02-04 20:36:13','2021-02-25 22:42:43'),(36,9,'Tranzitor',0,'2021-02-04 20:36:13','2021-02-25 22:42:43'),(37,10,'Triac được coi như một công tắc điện chuyên dùng để điều khiển thiết bị điện xoay chiều vì thế các chân của nó cũng gần tương đương với các thành phần của một công tắc điện tử.',1,'2021-02-04 20:36:13','2021-02-25 22:44:10'),(38,10,'Triac là một linh kiện điện tử bán dẫn chuyên dụng được sử dụng rất nhiều trong các bo mạch điện tử để đóng cắt điện xoay chiều cho các phụ tải.',1,'2021-02-04 20:36:13','2021-02-25 22:44:10'),(39,10,'Triac có thể điều khiển cho mở dẫn dòng bằng cả xung dương (dòng đi vào cực điều khiển), lẫn xung âm (dòng đi ra khỏi cực điều khiển).',1,'2021-02-04 20:36:13','2021-02-25 22:44:10'),(40,10,'Triac là phần tử bán dẫn gồm 6 lớp bán dẫn, tạo nên cấu trúc p-n-p-n như ở Tiristor theo cả 2 chiều giữa các cực T1 và T2, do đó có thể dẫn đóng theo cả hai chiều giữa T1 và T2.',0,'2021-02-04 20:36:13','2021-02-25 22:44:10'),(41,11,'TRIAC 4Q, Triacs 3Q, Snubber',0,'2021-02-04 20:36:13','2021-02-25 22:45:28'),(42,11,'T0 -220, T0-218X, T0-263, T0-252',0,'2021-02-04 20:36:13','2021-02-25 22:45:28'),(43,11,'Triac công suất lơn, Triac công suất lơn, Triac dán trên mạch, Triac cắm chân',1,'2021-02-04 20:36:13','2021-02-25 22:45:28'),(44,11,'Các đáp án trên đều đúng',0,'2021-02-04 20:36:13','2021-02-25 22:45:28'),(45,12,'nằm trong khối đơn vị cơ bản xây dựng nên cấu trúc mạch máy tính điện tử và tất cả các thiết bị điện tử hiện đại khác.',0,'2021-02-04 20:36:13','2021-02-25 22:47:22'),(46,12,'tính nhanh và chính xác của mình nên chúng được ứng dụng nhiều trong các ứng dụng tương tự và số.',0,'2021-02-04 20:36:13','2021-02-25 22:47:22'),(47,12,'được dùng trong các mạch khuếch đại đa chiều, khuếch đại tín hiệu (ac), mạch khuếch đại vi sai, các mạch khuếch đại đặc biệt, mạch ổn áp…',0,'2021-02-04 20:36:13','2021-02-25 22:47:22'),(48,12,'là loại linh kiện bán dẫn chủ động thường được sử dụng như một phần tử khuếch đại hoặc một khóa điện tử.',1,'2021-02-04 20:36:13','2021-02-25 22:47:22'),(49,13,'Hầu hết các loại transistor đều có cấu tạo gồm 4 lớp bán dẫn được ghép với nhau tạo thành 2 mối tiếp giáp P- N. Nếu xếp theo thứ tự PNP ta sẽ có Transister thuận, còn nếu xếp theo thứ tự NPN ta có Transistor ngược.',0,'2021-02-04 20:36:13','2021-02-25 22:48:45'),(50,13,'Trong mạch điện tử, transistor có vai trò như một nguồn cung cấp dòng điện, điện áp trong mạch.',0,'2021-02-04 20:36:13','2021-02-25 22:48:45'),(51,13,'Transistor là loại linh kiện bán dẫn tích cực và chúng cần phải có năng lượng để hoạt động. Tùy theo mục đích sử dụng mà transistor được mắc nối với các loại mạch điện khác nhau.',1,'2021-02-04 20:36:13','2021-02-25 22:48:45'),(52,13,'Về cơ bản, cấu tạo của transistor tương đương với cấu tạo của 2 diode đấu ngược chiều nhau. Đây chính là cấu trúc BJT với 2 loại điện âm và điện dương cùng chạy.',1,'2021-02-04 20:36:13','2021-02-25 22:48:45'),(53,14,'Đi ot',0,'2021-02-04 20:36:13','2021-02-25 22:50:46'),(54,14,'Triac',0,'2021-02-04 20:36:13','2021-02-25 22:50:46'),(55,14,'Tranzitor',1,'2021-02-04 20:36:13','2021-02-25 22:50:46'),(56,14,'Tiristor',0,'2021-02-04 20:36:13','2021-02-25 22:50:46'),(57,15,'Khuếch đại điện áp xoay chiều. Tín hiệu sử dụng trong mạch là tín hiệu xoay chiều',0,'2021-02-04 20:36:13','2021-02-25 22:52:08'),(58,15,'Khuếch đại công suất. Ứng dụng trong khuếch đại công suất cho hệ thống âm thanh, hệ thống điều khiển.',0,'2021-02-04 20:36:13','2021-02-25 22:52:08'),(59,15,'Khuếch đại chuyển mạch công tắc. Ứng dụng trong điều khiển rơ le chuyển mạch',0,'2021-02-04 20:36:13','2021-02-25 22:52:08'),(60,15,'Các đáp án trên đều đúng',1,'2021-02-04 20:36:13','2021-02-25 22:52:08'),(61,16,'Sự tích tụ của điện tích trên bốn bề mặt tạo ra khả năng tích trữ năng lượng điện trường của tụ.',0,'2021-02-04 20:36:13','2021-02-25 22:53:23'),(62,16,'có khả năng nạp và xả rất nhanh',1,'2021-02-04 20:36:13','2021-02-25 22:53:23'),(63,16,'là một loại linh kiện điện tử thụ động tạo bởi hai bề mặt dẫn điện được ngăn cách bởi điện môi.',1,'2021-02-04 20:36:13','2021-02-25 22:53:23'),(64,16,'Khi có chênh lệch điện thế tại hai bề mặt, tại các bề mặt sẽ xuất hiện điện tích cùng điện lượng và cùng dấu.',0,'2021-02-04 20:36:13','2021-02-25 22:53:23'),(65,17,'Tụ điện tích hợp, Tụ điện cố định, Tụ điện tuning, Tụ điện vacuum',0,'2021-02-04 20:36:13','2021-02-25 22:54:38'),(66,17,'Tụ điện trim, Tụ điện vacuum biến đổi, Tụ điện trench, Tụ điện MIS',0,'2021-02-04 20:36:13','2021-02-25 22:54:38'),(67,17,'Tụ điện gốm, tụ điện màng, tụ điện mica, tụ hóa nhôm',0,'2021-02-04 20:36:13','2021-02-25 22:54:38'),(68,17,'Tụ điện phân cực, Tụ điện không phân cực, Tụ điện có trị số biến đổi, Siêu tụ điện',1,'2021-02-04 20:36:13','2021-02-25 22:54:38'),(69,18,'Transistor',0,'2021-02-04 20:36:13','2021-02-25 22:57:28'),(70,18,'Ổn áp',1,'2021-02-04 20:36:13','2021-02-25 22:57:28'),(71,18,'IC',0,'2021-02-04 20:36:13','2021-02-25 22:57:28'),(72,18,'Triac',0,'2021-02-04 20:36:13','2021-02-25 22:57:28'),(73,19,'Transistor',0,'2021-02-04 20:36:13','2021-02-25 22:59:10'),(74,19,'Biến áp',1,'2021-02-04 20:36:13','2021-02-25 22:59:10'),(75,19,'Ổn áp',0,'2021-02-04 20:36:13','2021-02-25 22:59:10'),(76,19,'Antenna',0,'2021-02-04 20:36:13','2021-02-25 22:59:10'),(77,20,'Transistor',0,'2021-02-04 20:36:13','2021-02-25 23:00:49'),(78,20,'Biến áp',0,'2021-02-04 20:36:13','2021-02-25 23:00:49'),(79,20,'Ổn áp',0,'2021-02-04 20:36:13','2021-02-25 23:00:49'),(80,20,'Diac',1,'2021-02-04 20:36:13','2021-02-25 23:00:49'),(81,21,'Chức năng thiết kế',1,'2021-02-04 20:36:13','2021-03-01 18:05:51'),(82,21,'Cài đặt Vị trí',1,'2021-02-04 20:36:13','2021-03-01 18:05:51'),(83,21,'Cấp phép Altium Designer',0,'2021-02-04 20:36:13','2021-03-01 18:05:51'),(84,21,'Cả 3 phương án trên',0,'2021-02-04 20:36:13','2021-03-01 18:05:51'),(85,22,'cho phép bạn cài đặt và chạy trong thời gian nhanh nhất có thể',0,'2021-02-04 20:36:13','2021-03-01 18:07:34'),(86,22,'cho phép bạn chỉ định các thư mục đích để cài đặt, về cả vị trí cài đặt Tệp chương trình và Tài liệu được chia sẻ