INSERT INTO `blogs` VALUES (1,1,'Nội quy','<p style=\"text-align:left;\"><span style=\"color: rgb(5,5,5);background-color: rgb(255,255,255);font-size: 15px;font-family: inherit;\">ĐÂY LÀ NƠI TRAO ĐỔI NHỮNG THƯ VIỆN LINH KIỆN SCH , THƯ VIỆN CHÂN PCB, VÀ CÁC CÁCH XỬ LÝ LÀM VIỆC VỚI ALTIUM DESIGN. KHÔNG XIN XỎ. CHỈ ĐỰOC HỎI. </span></p>\n<p style=\"text-align:start;\"><span style=\"color: rgb(5,5,5);background-color: rgb(255,255,255);font-size: 15px;font-family: inherit;\">link phần mền mình đặt ở ảnh bìa, </span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(5,5,5);background-color: rgb(255,255,255);font-size: 15px;font-family: inherit;\">THÀNH VIÊN LÀ NHỮNG NGƯỜI DÙNG PHẦN MỀM. </span></p>\n<p style=\"text-align:start;\"><span style=\"color: rgb(5,5,5);background-color: rgb(255,255,255);font-size: 15px;font-family: inherit;\">NHỮNG AI ĐĂNG NHỮNG NỘI DÙNG KHÔNG LIÊN QUAN SẼ BỊ CHẶN.</span></p>','2021-02-22 09:42:14','2021-02-22 09:42:14'),(5,5,'sắp xếp linh kiện','<p><span style=\"color: rgb(5,5,5);background-color: rgb(255,255,255);font-size: 15px;font-family: Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif;\">Em chào mọi người, Emlà newbie mới học vẽ trên atlium, mọi người có thể xem cho e mạch e vừa làm cách sắp xếp linh kiện và đi dây như trong hình đã ổn chưa ạ và có cần điều chỉnh gì ko_ Em cảm ơn mọi người rất nhiều</span>&nbsp;</p>\n<img src=\"https://www.facebook.com/photo?fbid=539963753618716&set=gm.1809569352527468\" alt=\"undefined\" style=\"height: auto;width: 300px\"/>\n<p></p>','2021-02-22 14:08:02','2021-02-22 14:08:02'),(7,9,'Cài đặt','<p><span style=\"color: rgb(5,5,5);background-color: rgb(255,255,255);font-size: 15px;font-family: Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif;\">anh em cho hỏi là laptop cài win10 cài altium bản 10  hoặc bản 15 có được không nhỉ? mình đang cài bản 10, dùng quen nên ngại nâng cấp lên bản cao. chỉ vẽ vời mấy mạch công suất con con, không vẽ mạch tốc độ cao nên không quá quan trọng ver cao. bản 10 dùng quen.</span></p>','2021-02-24 13:26:21','2021-02-24 13:26:21');
/*!40000 ALTER TABLE `blogs` ENABLE KEYS */;
