INSERT INTO `comments` VALUES (4,5,9,'<p>b up lại ảnh, lỗi tải ảnh rồi b ơi</p>','2021-02-24 13:38:59','2021-02-24 13:38:59'),(5,7,4,'<p style=\"text-align:start;\"><span style=\"color: rgb(5,5,5);background-color: rgb(240,242,245);font-size: 15px;font-family: Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif;\">Thoải mái nhé, ko vấn đề gì cả.</span></p>\n<p style=\"text-align:start;\"><span style=\"color: rgb(5,5,5);background-color: rgb(240,242,245);font-size: 15px;font-family: Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif;\">Quan trọng là cấu hình máy, bản càng cao và vẽ mạch lớn thì cần cấu hình cao thôi.</span>&nbsp;</p>','2021-02-25 12:16:07','2021-02-25 12:16:07'),(6,5,5,'<p>https://ibb.co/KhXBJPZ</p>','2021-02-25 12:17:53','2021-02-25 12:17:53'),(8,5,22,'<p style=\"text-align:start;\"><span style=\"color: rgb(5,5,5);background-color: rgb(240,242,245);font-size: 15px;font-family: Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif;\">Cơ bản đầu tiên là cần đi dây layout theo thứ tự linh kiện giống với schematic. Ví dụ trong schematic bạn vẽ dây đi qua tụ rồi tới IC thì qua layout cũng vẽ theo thứ tự như vậy (tất nhiên là thứ tự bên schematic cho đúng nhé).</span></p>\n<p style=\"text-align:start;\"><span style=\"color: rgb(5,5,5);background-color: rgb(240,242,245);font-size: 15px;font-family: Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif;\">Còn 45 độ hay bo cong đường mạch cũng không ảnh hưởng lắm với mạch như này, có những mạch chạy 935Mhz mà nó vẫn đi 45 độ đó thôi, tốc độ cao hàng trăm MHz hàng GHz người ta sẽ qua tâm về chiều dài dây, trở kháng đường mạch,... và dây bo tròn tất nhiên sẽ hữu hiệu trong trường hợp này.</span></p>\n<p style=\"text-align:start;\"><span style=\"color: rgb(5,5,5);background-color: rgb(240,242,245);font-size: 15px;font-family: Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif;\">Bo tròn hay 45 độ hay vuông góc nó cũng có công dụng riêng của nó.</span></p>\n<p style=\"text-align:start;\"><span style=\"color: rgb(5,5,5);background-color: rgb(240,242,245);font-size: 15px;font-family: Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif;\">Riêng sắp xếp linh kiện thì cần phải tham khảo google thêm. Cơ bản là sắp xếp theo khối chức năng (Vd: khối nguồn, khối vi xử lý, khối RF, khối tần số cao, khối dễ nhạy cảm với nhiệt...) sau đó từng khối này phải sắp xếp trên nvùng PCB thích hợp để tránh gây ảnh hưởng đến nhau, từng khối nên đổ mass GND riêng sau đó nối GND lại với nhau tại 1 điểm.</span>&nbsp;</p>','2021-02-25 15:16:12','2021-02-25 15:16:12');
/*!40000 ALTER TABLE `comments` ENABLE KEYS */;
